import { HttpClientModule } from '@angular/common/http';
import { CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { TestBed } from '@angular/core/testing';
import { LogAnalyzerComponent } from './log-analyzer.component';
import { LogAnalyzerService } from './services/log-analyzer.service';
describe('LogAnalyzerComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        const logs = {
            "logType": "INFO",
            "logDataList": [
                {
                    "logName": "PaymentService:",
                    "logMessage": "payment observers size 4",
                    "logCount": 28
                },
                {
                    "logName": "LifecycleService:",
                    "logMessage": "[127.0.0.1]:5701 [dev] [3.2.5] Address[127.0.0.1]:5701 is STARTING",
                    "logCount": 26
                }
            ]
        };
        const logAnalyzerServiceSpy = jasmine.createSpyObj('LogAnalyzerService', ['viewLogs']);
        logAnalyzerServiceSpy.viewLogs.and.returnvalue(logs);
        await TestBed.configureTestingModule({
            imports: [HttpClientModule],
            providers: [{ provide: LogAnalyzerService, useValue: logAnalyzerServiceSpy }],
            declarations: [LogAnalyzerComponent],
            schemas: [CUSTOM_ELEMENTS_SCHEMA]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(LogAnalyzerComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
});
